import './App.css';
import Header  from './header';
import Banner from './banner';
import Products from './products';
import About from './about-us';
import Contact from './contact';
import Footer from './footer';

function App() {
  return (
    <div className="App">

      <Header/>
      <Banner/>
      <Products/>
      <About/>
      <Contact/>
      <Footer/>



    </div>
  );
}

export default App;
